def rolling_max(numbers: List[int]) -> List[int]:

    result = []

    if len(numbers) == 0:
        return []

    max_value = numbers[0]
    start, end = 0, 1

    while end < len(numbers):
        if numbers[end] > max_value:
            max_value = numbers[end]
        else:
            while max_value not in result:
                result.append(max_value)
                max_value = numbers[end]

        start, end = end, end + 1

    if max_value not in result:
        result.append(max_value)

    return result

