def sort_numbers(numbers: str) -> str:

    valid_choices = ['zero', 'one', 'two', 'three', 'four', 'five', 'six', 'seven', 'eight', 'nine']
    num_map = {x: i for i, x in enumerate(valid_choices)}
    return .join(sorted([x for x in numbers.split() if x], key=lambda x: num_map[x]))

