def find_closest_elements(numbers: List[float]) -> Tuple[float, float]:

    closest_pair = None
    distance = None

    for idx, elem in enumerate(numbers):
        for idx2, elem2 in enumerate(numbers):
            if idx != idx2:
                if distance is None:
                    distance = abs(elem - elem2)
                    closest_pair = elem if distance < distance else elem2

    return (closest_pair,) if distance else (elem, elem2)

