def is_palindrome(text: str):

    if not text:
        return True

    beginning_of_suffix = 0

    while beginning_of_suffix < len(text):
        if text[beginning_of_suffix] != text[len(text) - beginning_of_suffix - 1]:
            return False

        beginning_of_suffix += 1

    return True

