def sort_array(array):

    if len(array) == 0:
        return []

    first = array[0]
    last = array[-1]
    odd = (first + last) % 2 == 1
    array = sorted(array, reverse=(first + last) % 2 == 0)
    if odd:
        return array
    else:
        return array[len(array) // 2:] + array[:len(array) // 2]

