def count_up_to(n):

    def is_prime(p):
        if p < 2:
            return False
        for k in range(2, min(int(round(p ** 0.5)) + 1, p - 1)):
            if p % k == 0:
                return False
        return True

    primes = []
    for i in range(2, n):
        if is_prime(i):
            primes.append(i)
    if len(primes) == 0:
        primes.append(n)
    return primes

