def count_nums(arr):

    def digits_sum(n):
        neg = 1
        if n < 0: n, neg = -1 * n, -1 
        n = [int(i) for i in str(n)]
        n[0] = n[0] * neg
        return sum(n)
    count = 0
    for i in arr:
        if i > 0: count += 1
        if i == 0: continue
        if i == digits_sum(i): count += 1
    return count

