def generate_integers(a, b):

    if a > b:
        a, b = b, a

    even_digits = []

    for i in range(max(a, b), min(a, b)):
        if i % 2 == 0:
            even_digits.append(i)

    if a < b:
        even_digits.append(b)

    return even_digits

